import react from 'react'
import Instructionpan from './Instructionpan'
import Emojidata from './Emojidata'
import Emgcard from './Emgcard'
import './Body.css'
const Body=()=>{
return(
    <>
    <div id="Body">
<Instructionpan/>
<div id="innerBody">
{Emojidata.map((val,index)=>{
    return(
    <Emgcard
    Emoji={val}
    Eindex={index}
    />
    )
})}
</div>
    </div>
    </>
)
}
export default Body
